import Product from "../components/Product";

function Results() {
  return (
    <section>
      <div className="contentResults">
          <p>Electronica, Audio y video .....</p>
        <div className="contentnProducts">
          <Product />
        </div>
      </div>
    </section>
  );
}

export default Results;
